class testnet
{
public:
  testnet();
  double operator()(const vector<double> &x);
  void useLast(int n);

private:
  vector <int> shape;
  vector < vector<double> > weights;
  int numnet;
  int netUsed;
  double netOut(const vector<double> &x, int wSet);

  //initilize temp vectors to avoid constant memory allocation
  vector <double> y, next, Wi;
};

//FUCNTION DEFINITIONS ---------------------------------------------------------
//Network constructor using pretrained weights
testnet::testnet()
//Network constructor using pretrained weights
{
  shape.push_back(2);
  shape.push_back(10);
  shape.push_back(1);
  numnet = 200;
  netUsed = numnet;

  //placing trained weights in a vector
  for (int i = 0; i < netUsed; i++)
    weights.push_back(vector<double>(w[i], w[i] + sizeof w[i] / sizeof w[i][0]));
}

double testnet::netOut(const vector<double> &x, int wSet)
{
  int shift = 0;
  Wi = weights[wSet];

  //copy initial input
  y.resize(0);
  for (int i=0; i < shape[0]; i++)
    y.push_back(x[i]);

  //calulate new layer outputs
  for (int k=0; k < shape.size() - 1; k++)
  {

    //individual neuron values
    next.resize(0);
    for (int i = 0; i < shape[k+1]; i++)
    {
      double next_i = (Wi[shift + (shape[k]+1)*i]);
      for (int j = 0; j < shape[k]; j++)
        next_i += Wi[shift + (shape[k]+1)*i + j+1] * y[j];

      //take tanh for all neuron except final output neurons
      if (k < shape.size() - 2)
        next_i = tanh(next_i);

      next.push_back(next_i);
    }

    //shift over to next layer's weights
    shift += shape[k+1] + shape[k]*shape[k+1];
    //replace inputs to layer with outputs from layer
    y = next;
  }

  return y[0];
}

double testnet::operator()(const vector<double> &x)
{
  double output = 0.0;
  for (int i = numnet - netUsed; i < numnet; i++)
    output += netOut(x, i);
  return output / netUsed;
}

void testnet::useLast(int n)
//use last n networks in operator()
{
  if (n < 1)
    netUsed = 1;
  else if (n > numnet)
    netUsed = numnet;
  else
    netUsed = n;
}

